            <Column
                columnKey="Arrive"
                header={<Cell>Arrive</Cell>}
                width={130}
                cell={({ rowIndex, columnKey }) => {
                    return <Cell>{this.props.datas[rowIndex][columnKey]}</Cell>;
                }}
            />

        </Table>
    ))
}

}

export default Searcher;
